sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
gs.info("1319091 inside line 3"+inputs.decisionData);
gs.info("1319091 inside line 6"+inputs.parentSysID.sys_id);
var arr = [];
gs.info("1319091 inside line 7"+inputs.decisionData.label);
arr.push(inputs.decisionData.label);
gs.info("1319091 inside line 4"+arr.length);
var count = 0;
var groupSysid = '';

    var b = arr.split(',');
    for (var i = 0; i < b.length; i++) {
        count++;
        var c = b[i].split(': ');
        gs.info(c[1]);
        if (c[1] != '') {
            var group = new GlideRecord('sys_user_group');
            group.addQuery('name', c[1]);
            group.query();
            if (group.next()) {
                gs.info("groupSysi line 17");
                groupSysid = group.getUniqueValue();
            }
            gs.info("groupSysid" + groupSysid);
            var d = new GlideRecord('x_1040502_nsc_pe_0_approval_routing_preview');
            d.initialize();
            d.approval_group = groupSysid;
            d.parent = inputs.parentSysID.sys_id;
            d.level = parseFloat(count);
            d.insert();
        }
    }

})(inputs, outputs);

